import json
import numpy as np
import matplotlib.pyplot as plt
from matplotlib.patches import RegularPolygon

# This script take chunk data and transform it into images using matplotlib

def generate_one_chunk_image(json_data, options, color_map):

    fig, ax = plt.subplots(figsize=(25, 25))
    array_32_32_density = [json_data['biome_density'][i*32:(i+1)*32] for i in range(32)]
    array_32_32 = [json_data['biomes'][i*32:(i+1)*32] for i in range(32)]
    values = np.array(array_32_32)
    values_density = np.array(array_32_32_density)
    
    for row in range(options['chunk_y']):
        for col in range(options['chunk_x']):
            
            # Calculate hex center x, y for pointy-topped hexagons
            x = col * options['hex_width']
            y = row * (options['hex_height'] * 3/4)
            if row % 2 == 1:
                x += options['hex_width'] / 2

            val = values[row, col]
            val = val if val in range(15) else 0
            color = color_map[val]

            hexagon = RegularPolygon(
                (x, y),
                numVertices = 6,
                radius = options['hex_radius'],
                orientation = 0,
                facecolor = color,
                edgecolor = 'none',
                antialiased = False
            )
            ax.add_patch(hexagon)
            byte1 = (values_density[row, col] >> 24) & 0xFF
            byte2 = (values_density[row, col] >> 16) & 0xFF
            byte3 = (values_density[row, col] >> 8)  & 0xFF
            byte4 = values_density[row, col] & 0xFF
            ax.text(x, y, str(byte1) + ' ' + str(byte2) + '\n' + str(byte3) + ' ' + str(byte4), ha='center', va='center', fontsize=8)


    # Set limits to avoid trimming
    ax.set_xlim(-options['hex_width'] / 2, options['hex_width'] * (options['chunk_x'] + 0.5))      # Math Sorcery
    ax.set_ylim(-options['hex_radius'], options['hex_height'] * (options['chunk_y'] * 3/4 + 0.25)) # Math Sorcery
    ax.set_aspect('equal')                                        # Makes the aspect ratio of height and width the same
    ax.axis('off')                                                # Remove legend on the sides

    chunk_filename = 'assets/chunk_' + str(json_data['chunk_x']) + '_' + str(json_data['chunk_z']) + '.png'

    plt.savefig(
        chunk_filename,
        dpi = 100,
        bbox_inches = 'tight',
        pad_inches = 0,
        transparent = True
    )
    plt.close(fig)
    plt.close()
    print('generated chunk_' + str(json_data['chunk_x']) + '_' + str(json_data['chunk_z']) + '.png')

